{% block session_alert %}
  {% import _self as layout %}
  {{ parent() }}
  {% if app.session.flashbag.peek('psxdesign-info')|length() > 0 %}
      {{ app.session.flashbag.get('psxdesign-info')[0]|raw }}
  {% endif %}
  {% if app.session.flashbag.peek('psxdesign-success')|length() > 0 %}
